import React, { Component } from "react";
import { View, Text, StyleSheet, TouchableOpacity, Image, Dimensions } from "react-native";
const commonColor = require("../../theme/variables/commonColor");
const logo = require("../../../assets/logo.png");
const deviceHeight = Dimensions.get("window").height;
const deviceWidth = Dimensions.get("window").width;

class Category extends Component {
    render() {
        return (
            <View style={styles.container}>
                <View style={styles.logoContainerView}>
                    <Image source={logo} style={styles.imageShadow} />
                </View>
                <View style={{ margin: 20 }}>
                    <Text style={{ fontSize: 20, fontWeight: "bold" }}>User Category</Text>
                </View>
                <TouchableOpacity style={styles.category} onPress={() => this.props.navigation.navigate("Drawer")} >
                    <Text style={{ color: "white" }}>Farmers</Text>
                </TouchableOpacity>
                <TouchableOpacity style={styles.category} onPress={() => this.props.navigation.navigate("Retailler")}>
                    <Text style={{ color: "white" }}>Retailers</Text>
                </TouchableOpacity>
                <TouchableOpacity style={styles.category} onPress={() => this.props.navigation.navigate("Consumer")}>
                    <Text style={{ color: "white" }}>Consumers</Text>
                </TouchableOpacity>
            </View>
        );
    }

}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: "center",
        backgroundColor: "white"
    },
    category: {
        backgroundColor: "#0b3d20",
        padding: 20,
        marginTop: 10,
        width: deviceWidth / 3,
        alignItems: "center"

    },
    logoContainerView: {
        height: deviceHeight / 3,
        backgroundColor: commonColor.brandPrimary
    },
    imageShadow: {
        width: deviceWidth / 3,
        height: deviceWidth / 3,
        resizeMode: "contain",
        alignSelf: "center",
        marginTop: deviceHeight / 12
    },
});

export default Category;
